import React from 'react';
import HomeNavBar from './Components/HomeNavBar'
import HomeCarousel from './Components/HomeCarousel';

const HomePage = () => (
    
    
    <div>
        <header><HomeNavBar/></header>
        <div>
            <HomeCarousel/>
        </div>        
    </div>
    );
    
    
    export default HomePage;
